import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View , Button , TextInput, ImageBackground } from 'react-native';

export default function App() {
  return (

    <View style ={{padding :10 }} >
      <ImageBackground source={'./ImageBackground.png'} style={{width: '100%', height: '100%'}}>
    <Text>Inside</Text>
  </ImageBackground>
      <View>
      <View style ={{padding : 50}} >
      <TextInput placeholder="nom admin"/>
      </View>
      <View style ={{padding : 50}} >
      <TextInput placeholder="mot de pass"/>
      </View>
      </View>
       <View style ={{padding :50 }} >
      <Button title="se connecter avec facebook" />
      </View>
      <View style ={{padding: 50}} >
      <Button title="se connecter avec email " />
      </View>

    </View>
  );
}
